package Optional;

public class Godness {
	private String name;

	@Override
	public String toString() {
		return "Godness [name=" + name + "]";
	}

	public Godness(String name) {
		super();
		this.name = name;
	}

	public Godness() {
		super();
		// TODO Auto-generated constructor stub
	}

	public String getName() {
		return name;
	}

	public void setName(String name) {
		this.name = name;
	}
	
	

}
